PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);

CREATE TABLE site (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	url VARCHAR(255) NOT NULL, 
	method VARCHAR(50) NOT NULL, 
	active BOOLEAN NOT NULL, 
	country VARCHAR(50) NOT NULL, 
	type VARCHAR(50) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name), 
	UNIQUE (url)
);
CREATE TABLE optimization_result (
	id INTEGER NOT NULL, 
	card_names JSON, 
	results JSON, 
	timestamp DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE IF NOT EXISTS "scan_result" (
	id INTEGER NOT NULL, 
	scan_id INTEGER NOT NULL, 
	card_id INTEGER NOT NULL, 
	site_id INTEGER NOT NULL, 
	price FLOAT NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(scan_id) REFERENCES scan (id), 
	FOREIGN KEY(card_id) REFERENCES card (id), 
	FOREIGN KEY(site_id) REFERENCES site (id)
);
CREATE TABLE sets (
	id VARCHAR(36) NOT NULL, 
	code VARCHAR(10) NOT NULL, 
	tcgplayer_id INTEGER, 
	name VARCHAR(255) NOT NULL, 
	uri VARCHAR(255), 
	scryfall_uri VARCHAR(255), 
	search_uri VARCHAR(255), 
	released_at DATE, 
	set_type VARCHAR(50), 
	card_count INTEGER, 
	printed_size INTEGER, 
	digital BOOLEAN, 
	nonfoil_only BOOLEAN, 
	foil_only BOOLEAN, 
	icon_svg_uri VARCHAR(255), 
	last_updated DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_sets_code UNIQUE (code)
);


CREATE TABLE IF NOT EXISTS "scan" (
	id INTEGER NOT NULL, 
	created_at DATETIME, 
	PRIMARY KEY (id)
);

CREATE TABLE scryfall_card_data (
	id INTEGER NOT NULL, 
	card_name VARCHAR(255) NOT NULL, 
	oracle_id VARCHAR(255) NOT NULL, 
	multiverse_ids VARCHAR(255), 
	reserved BOOLEAN, 
	lang VARCHAR(10), 
	set_code VARCHAR(10), 
	set_name VARCHAR(255), 
	collector_number VARCHAR(20), 
	variation BOOLEAN, 
	promo BOOLEAN, 
	prices JSON, 
	purchase_uris JSON, 
	cardconduit_data JSON, 
	scan_timestamp DATETIME, 
	purchase_data JSON, 
	PRIMARY KEY (id)
);
CREATE TABLE user_buylist_card (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	edition VARCHAR(255), 
	version VARCHAR(255), 
	foil BOOLEAN, 
	quality VARCHAR(255) NOT NULL, 
	language VARCHAR(255) NOT NULL, 
	quantity INTEGER NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE marketplace_card (
	id INTEGER NOT NULL, 
	site VARCHAR(255) NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	edition VARCHAR(255) NOT NULL, 
	version VARCHAR(255), 
	foil BOOLEAN NOT NULL, 
	quality VARCHAR(255) NOT NULL, 
	language VARCHAR(255) NOT NULL, 
	quantity INTEGER NOT NULL, 
	price FLOAT NOT NULL, 
	set_id INTEGER, 
	PRIMARY KEY (id), 
	CONSTRAINT fk_card_set_id FOREIGN KEY(set_id) REFERENCES sets (id)
);
DELETE FROM sqlite_sequence;
COMMIT;
